import PageLayout from '../../components/page/PageLayout';
import Card from './components/Card';
import api from '../../api/completion';
export default {
  name: 'completionDocument',
  components: {
    Card: Card,
    PageLayout: PageLayout
  },
  data: function data() {
    return {
      completionList: []
    };
  },
  mounted: function mounted() {
    var _this = this;

    api.getCompletionList(this.$store.getters.projectSelected.id).then(function (data) {
      _this.completionList = data.sort(function (x, y) {
        return x.id < y.id;
      });
    });
  },
  computed: {}
};
